import { Heading, Button, useColorMode } from '@chakra-ui/core';
import Layout from '../components/layout/Layout';

const Home = (props) => {
  const [colorMode, setColor] = useColorMode();
  return (
    <Layout>
      <Heading>HOME</Heading>
      <Button onClick={setColor}>Change Theme</Button>
    </Layout>
  );
};

export default Home;
